import { Avatar } from "@material-ui/core";
import "./video.css";

const Video = () => {
    return (
        <div className="video">
            <div className="video__wrapper">
                <img
                    src="https://cuoixastress.com/wp-content/uploads/2021/06/anh-hot-girl-lanh-lung-42.gif"
                    alt=""
                    className="video__img"
                />
                <div className="video__block">
                    <Avatar src="https://cuoixastress.com/wp-content/uploads/2021/06/anh-hot-girl-lanh-lung-42.gif" />
                    <div className="video__container">
                        <span className="video__heading">
                            Phía sau một cô gái - Soobin Hoàng Sơn
                        </span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Video;
